import React from 'react';
import Container from 'react-bootstrap/Container';


export default function StudyLegend({ study: { ratios, ratiosEx, info, citation, comment, additionalReading } }) {
    return (
        <Container id="legend" fluid
            style={{
                backgroundColor: "lightgrey",
                margin: "2% 0 1% 0",
                textAlign: "left",
                padding: "1% 1% 1% 1%"
            }}
        >
           <p><strong>Data : </strong> As part of Individual Project for CS6400 this web application is for people to perform a basic assessment and risk calculation of a COVID-19 patient ending up in the ICU, developing acute respiratory distress syndrome (ARDS), and overall death. The data has been reviewed and compiled from studies published about patients in Wuhan, listed at the <a href="#legend" style={{ color: "#0056b3" }}></a></p>
            <p><strong>Ratios: </strong>{ratios}</p>
            {ratiosEx
                ? <p><strong>Examples: </strong>{ratiosEx}</p>
                : null
            }
            <p> <strong>Source: </strong>{citation} </p>
            {
                additionalReading
                    ? <p> <strong>Recommended Additional Reading: </strong>{additionalReading} </p>
                    : null
            }
            {
                comment
                    ? <p> <strong>Note: </strong>{comment} </p>
                    : null
            }
            <span> {info} </span>
        </Container>
    )
}
